import React, {Component} from "react";
import {robots} from './robots';
import CardList from './CardList';
import SearchBox from './SearchBox';
class App extends Component{
    constructor(){
        super();
        this.state={
            robots:robots
        }
    }
    render(){
        return (
            <div style={{textAlign:'center'}}>
                <h1 >RoboFriends</h1>
                <SearchBox />
                <CardList robots={robots}/>
            </div>
        );
    }
}
export default App;
